import earth from "../img/earth.png";

const Reach = () => {
  return (
    <>
      <section id="reach">
        <div className="ceo">
          
        </div>

        <div className="earth">
          <picture>
            <img src={earth} alt="Earth" />
            </picture>
        </div>
      </section>
    </>
  )
}

export default Reach;
